nditions at our discretion by changing them on our website. Clause 17.8 states when the last changes were made. The current version of these Terms and Conditions as displayed on our Portal, will apply. \\015\\012\\015\\0122.5 Misuse of the Services is prohibited. Please refer to clause 8 for Your obligations in relation to the use of the Services. \\015\\012\\015\\0123. DEFINITIONS\\015\\012\\015\\0123.1 In these Terms and Conditions, the following definitions shall apply:\\015\\012\\015\\012\\342\\200\\234Agreement\\342\\200\\235 means the agreement between us which incorporates these Terms and Conditions;\\015\\012\\342\\200\\234Buyer\\342\\200\\235 means the buyer in the Transaction;\\015\\012\\342\\200\\234Buyer\\342\\200\\231s Conveyancer\\342\\200\\235 means the conveyancing professional acting for and on behalf of the Buyer in the Transaction;\\015\\012\\342\\200\\234Charges\\342\\200\\235 means the charges payable for the provision of the Services;\\015\\012\\342\\200\\234Client\\342\\200\\235 means the person/s and/or organisation/s who has instructed the conveyancer in relation to the Transaction;\\015\\012\\342\\200\\234Client Data\\342\\200\\235 means the data added by the Client or on behalf of the Client;\\015\\012\\342\\200\\234Conveyancers\\342\\200\\235 means all conveyancing professionals acting for and on behalf of the Seller and Buyer and Lender in the Transaction;\\015\\012\\342\\200\\234Data\\342\\200\\235 means any Client Data, any data relating to \\342\\200\\231parties\\342\\200\\231 involved in the Transaction, together with any data collected by the system relating to the Transaction;\\015\\012\\342\\200\\234DPA\\342\\200\\235 means the Data Protection Act 1998, as amended and updated from time to time;\\015\\012\\342\\200\\234Insurance\\342\\200\\235 means the insurance policy supplied by us as part of providing Services;\\015\\012\\342\\200\\234Intellectual Property Rights\\342\\200\\235 means all intellectual property rights and industr