nditions at our discretion by changing them on our website. Clause 17.8 states when the last changes were made. The current version of these Terms and Conditions as displayed on our Portal, will apply. \\015\\012\\015\\0122.5 Misuse of the Services is prohibited. Please refer to clause 8 for Your obligations in relation to the use of the Services. \\015\\012\\015\\0123. DEFINITIONS\\015\\012\\015\\0123.1 In these Terms and Conditions, the following definitions shall apply:\\015\\012\\015\\012\\342\\200\\234Agreement\\342\\200\\235 means the agreement between us which incorporates these Terms and Conditions;\\015\\012\\342\\200\\234Buyer\\342\\200\\235 means the buyer in the Transaction;\\015\\012\\342\\200\\234Buyer\\342\\200\\231s Conveyancer\\342\\200\\235 means the conveyancing professional acting for and on behalf of the Buyer in the Transaction;\\015\\012\\342\\200\\234Charges\\342\\200\\235 means the charges payable for the provision of the Services;\\015\\012\\342\\200\\234Client\\342\\200\\235 means the person/s and/or organisation/s who has instructed the conveyancer in relation to the Transaction;\\015\\012\\342\\200\\234Client Data\\342\\200\\235 means the data added by the Client or on behalf of the Client;\\015\\012\\342\\200\\234Conveyancers\\342\\200\\235 means all conveyancing professionals acting for and on behalf of the Seller and Buyer and Lender in the Transaction;\\015\\012\\342\\200\\234Data\\342\\200\\235 means any Client Data, any data relating to \\342\\200\\231parties\\342\\200\\231 involved in the Transaction, together with any data collected by the system relating to the Transaction;\\015\\012\\342\\200\\234DPA\\342\\200\\235 means the Data Protection Act 1998, as amended and updated from time to time;\\015\\012\\342\\200\\234Insurance\\342\\200\\235 means the insurance policy supplied by us as part of providing Services;\\015\\012\\342\\200\\234Intellectual Property Rights\\342\\200\\235 means all intellectual property rights and industry property rights of any kind including without limitation patents, patent applications, copyright, know how, technical and commercial information, design (whether registered or unregistered), design rights, internet domain names, database rights, trade marks, service marks or business names, applications to register any of the foregoing rights, trade secrets and rights of confidence, in each case ion any part of the world and whether or not registered or registerable;\\015\\012\\342\\200\\234Lender\\342\\200\\235 means the entity which is lending funds to the Buyer in the Transaction;\\015\\012\\342\\200\\234Logo\\342\\200\\235 the logo device displayed in Appendix A in 19.1 below;\\015\\012\\342\\200\\234Party/ies\\342\\200\\235 means the entity/ies with a personal or professional interest in the Transaction;\\015\\012\\342\\200\\234Portal\\342\\200\\235 means the portal available on the Website www.safemovescheme.co.uk, from which the Services can be accessed;\\015\\012\\342\\200\\234Privacy Policy\\342\\200\\235 means our privacy policy which can be found at www.safemovescheme.co.uk, which sets out how we can process personal data on your behalf;\\015\\012\\342\\200\\234Property\\342\\200\\235 means the property being purchased or sold as part of the Transaction;\\015\\012\\342\\200\\234Protected Events\\342\\200\\235 Loss caused by fraud which prevents you from registering your ownership on the HMLR Proprietorship Register following exchange of contracts on the Transaction\\015\\012\\342\\200\\234Report\\342\\200\\235 means the report which is provided by us which incorporates data provided by us, or a Third Party Data Provider;\\015\\012\\342\\200\\234Seller\\342\\200\\235 means the seller in the Transaction;\\015\\012\\342\\200\\234Seller\\342\\200\\231s Conveyancer\\342\\200\\235 means the conveyancing professional acting for and on behalf of the Seller in the Transaction;\\015\\012\\342\\200\\234Services\\342\\200\\235 means the services made available to you by us including fraud detection, prevention and insurance cover referred to as Safe Buyer and Safe Seller as further described in www.safemovescheme.co.uk;\\015\\012\\342\\200\\234Terms and Conditions\\342\\200\\235 means the Safe Move Scheme Terms and Conditions as set out in this document, as amended from time to time by us;\\015\\012\\342\\200\\234Third Party Data Provider\\342\\200\\235 means third parties who licence their data to be delivered by us to provide Services;\\015\\012\\342\\200\\234Transaction\\342\\200\\235 means the sale or purchase of a property;\\015\\012\\342\\200\\234User/s\\342\\200\\235 means any person/s using the Portal;\\015\\012\\342\\200\\234Website\\342\\200\\235 means the website found at www.safemovescheme.co.uk;\\015\\012\\342\\200\\234Working Hours\\342\\200\\235 means 09:00 to 17:00 Monday to Friday excluding bank holidays in England and Wales.\\015\\012\\015\\0124. PROVISON OF THE SERVICES\\015\\012\\015\\0124.1 Subject to Us receiving payment for Services We will provide the Services to You in accordance with these Terms and Conditions.\\015\\012\\015\\0124.2 We will endeavour to make the Services available to You during Working Hours. We will use reasonable endeavours to ensure that any maintenance to the Website or Services only occurs outside of Working Hours; however, You acknowledge and agree that this may sometimes not be possible.\\015\\012\\015\\0124.3 We may from to time to time conduct maintenance of the Services or suspend or discontinue any aspect of the Portal or Website, which may include Your access to it. Subject to Our notifying You to the contrary, any amendments or new content to the Services will be subject to these Terms and Conditions.\\015\\012\\015\\0124.4 You acknowledge and agree that Our ability to provide the Services to You is dependent on the Buyer, the Buyer\\342\\200\\231s Conveyancer, the Seller\\342\\200\\231s Conveyancer and the Seller providing data and paying the charges (as may be relevant). In the event that any of these parties do not provide Us with the information, or fail to pay the relevant charges, We will be unable to provide all or part of the Services to You. You will be notified in the event that the Client has not completed their obligations within certain timescales specified by Us.\\015\\012\\015\\0125. USING THE SAFE MOVE SCHEME\\015\\012\\015\\0125.1 To use the Service, You must login to the Portal and submit true and accurate details. At Our sole discretion, We may refuse Your application for the Services. \\015\\012\\015\\0125.2 We reserve the right to refuse registration to, or suspend Your (or any of Your employees\\342\\200\\231) use of, the Services, the Report, or any associated intellectual property at any time, at Our absolute discretion.\\015\\012\\015\\0125.3 Each login is for a single user only. Your employees may not share their username and password with any other person or with multiple users on a network. \\015\\012\\015\\0125.4 You warrant and undertake that all information provided by You to Us, for the purposes of using the Services, is accurate and complete. \\015\\012\\015\\0125.5 You accept sole responsibility for all use of and for keeping confidential any account ID and password that may have been given to You or chosen by You for use in accessing the Portal. You will notify Us immediately of any unauthorised use of them or any other breach of security of the Portal of which You become aware, or which You reasonably believe may occur. \\015\\012\\015\\0126. INTELLECTUAL PROPERTY\\015\\012\\015\\0126.1 The copyright and all other Intellectual Property Rights relating to the Logo and vesting in the Portal (including all database rights, trade marks, service marks, trading names, text, graphics, code, files and links), the Website and the Report belong to us, or our licensor(s). \\015\\012\\015\\0126.2 Other than the limited licences set out in these Terms and Conditions, nothing shall have the effect of transferring any right title or interest in the Intellectual Property Rights, described at Clause 6.1, to you. \\015\\012\\015\\0126.3 Subject to You complying with Your obligations under this Agreement, We hereby grant You a non-transferable, revocable licence to:\\015\\012\\015\\0126.3.1 Make and store electronic or hard copies of the Report solely in relation to the Transaction;\\015\\012\\015\\0126.3.2 incorporate the Report into written advice prepared by You for the Client or Lender (as the case may be) in the normal course of business; or\\015\\012\\015\\0126.3.3 disclose the Report in the normal course of business to: (i) the Client for whom the Report relates; (ii) the Lender; or (iii) any person who acts in a professional or advisory capacity for any person named in this clause 6.3.3.\\015\\012\\015\\0126.4 Notwithstanding the limited licence granted under clause 6.3, You must not copy, transmit, modify, republish, store (in whole or in part), frame, pass-off or link to any material or information utilised from the Services (or downloaded from the Website) without Our prior written consent. \\015\\012\\015\\0126.5 Without limitation to the rights granted in these Terms and Conditions, the Logo is our registered trade mark. You may not use or copy this or any other logos, brand or trade marks belonging to us without our prior written consent. \\015\\012\\015\\0126.6 You undertake that You will not make or store any copy or copies of the Report, save that You may store the Report only to the extent that it is associated with the Transaction. You shall not store any data contained within the Report in a way which would or could facilitate its use providing search related information against another property transaction. A breach of this clause 6.6 shall be deemed to be irremediable and We shall have the right to immediately terminate this Agreement and any licence granted to You in relation to the use of the Report.\\015\\012\\015\\0126.7 The Website may contain links to Websites operated by third parties. We have no control over their individual content. We therefore make no warranties, or representations as to the accuracy or completeness of any of the information appearing in relation to any linked Websites. The links are for Your convenience only. We do not recommend any products or services advertised on those Websites. If You decide to access any third party Website linked from Our Website, You do so at Your own risk. \\015\\012\\015\\0126.8 Any communications such as press releases, Website content and printed material that make reference to the Safe Move Scheme must be approved in writing by BE Consultancy Ltd before being used.\\015\\012\\015\\0127. DATA\\015\\012\\015\\0127.1 We will collect and process the personal data (as defined in the DPA) provided by Conveyancers and the Client. Our Privacy Policy, applies to all personal data that We collect. The terms of the Privacy Policy, are incorporated into the terms of this Agreement.\\015\\012\\015\\0127.2 We will comply with the DPA in the manner and for the purposes We process personal data provided by You. For the purposes of the DPA, You shall be the data processor and We shall be the data controller.\\015\\012\\015\\0127.3 We will use the personal data provided by You to provide the Services in accordance with the Terms and Conditions and may also:\\015\\012\\015\\0127.3.1 Pass the personal data to a Third Party Data Provider to the extent necessary to allow the Third Party Data Provider to provide services to Us as part of the Services;\\015\\012\\015\\0127.3.2 if We are requested to do so by a regulatory body, governmental authority or court of competent jurisdiction;\\015\\012\\015\\0127.3.3 if We are compelled to do so by law; or\\015\\012\\015\\0127.3.4 if We reasonably believe an emergency, potential illegal activity, or some other reasonable reason exists for doing so.\\015\\012\\015\\0127.4 You shall in processing the data for the purposes of this Agreement