 data in the manner set out in clause 7.\\015\\012\\015\\0127.7 To the extent that We may incur any loss, damage, costs (including court and other legal costs), or expenses as a result of Your failure to comply with this clause 7, You shall indemnify Us in full and keep Us indemnified at all times.\\015\\012\\015\\0128. YOUR OBLIGATIONS AND CONDUCT\\015\\012\\015\\0128.1 You accept that You are solely responsible for ensuring that Your computer systems meet all relevant technical specifications necessary to use the Services.\\015\\012\\015\\0128.2 You must not misuse the Services. In particular, Your must not hack into, circumvent security or otherwise disrupt the operation of the Portal, Website or Services, or attempt to carry out any of the foregoing. \\015\\012\\015\\0128.3 You must not use or attempt to use any automated program (including, without limitation, any spider or other Web crawler) to access the Services, Portal or the Website, or to search, display or obtain links to any part of the Services, Portal, or the Website, unless doing so with prior written permission.  Any such use or attempted use of an automated program shall be a misuse of the Services, the Portal and/or the Website. A breach of this clause 8 shall be deemed to be irremediable and We shall have the right to immediately terminate this Agreement.\\015\\012\\015\\0128.4 You must deploy and maintain current industry standard virus protection and take all reasonable precautions to ensure that You do not, and do not allow any third party, directly or indirectly to upload, transmit, or distribute computer viruses, worms, malicious code, macro viruses, Trojan horses, or similar programs.\\015\\012\\015\\0128.5 You must not include links to the Portal or Website in any other Website without Our prior written consent. In particular (but without limiting the foregoing) You must not include in any other Website any "deep link" to any page on the Website other than the home page at www.safemovescheme.co.uk without Our prior written consent. \\015\\012\\015\\0128.6 You must not upload or use inappropriate or offensive language or content or solicit any commercial services in any communication, form or email You send or submit, from or to the Services. \\015\\012\\015\\0128.7 You acknowledge and agree that You shall make reasonable inspection of any Report, whether provided by Us in relation to Services or otherwise, and all associated Data to satisfy Yourself that there are no apparent defects and that You will decide whether or not the transaction may proceed in the best interest of the Client. We will not be liable to You for any such defect or failure to identify such defects.\\015\\012\\015\\0128.8 Notwithstanding Our obligations to Your in relation to the contents of the Report, Your acknowledge and agree that We shall not be liable to You for any professional judgments and decisions that You may make resulting from the Report.\\015\\012\\015\\0128.9 You warrant and represent that:\\015\\012\\015\\0128.9.1 The information supplied by You when utilising the Services is true, accurate and complete and that it will notify Us in writing of any changes in such information;\\015\\012\\015\\0128.9.2 You will keep all information provided by Us confidential and shall take all reasonable steps to ensure that any such information provided to third parties is also kept confidential. In doing so You shall ensure that such confidential information is kept in a manner no less secure than Your own confidential information.\\015\\012\\015\\0128.9.3 You will not allow any third party to use the Portal or any materials (including the Report), documents or data taken from the Portal or Website;\\015\\012\\015\\0128.9.4 You are authorised to receive the Services in accordance with the Terms and Conditions; \\015\\012\\015\\0128.9.5 You will keep confidential and secure all user names and passwords used in relation to the Services; \\015\\012\\015\\0128.9.6 You warrant and represent that You will ensure all images of documents that You upload to the Portal are good quality faithful representations of the document in Your possession;\\015\\012\\015\\0128.9.7 You will ensure all documents that You upload to the Portal have not been altered for the purpose of misleading any user; and\\015\\012\\015\\0128.9.8 You will only upload appropriate documents and images to the Portal; and\\015\\012\\015\\0128.9.9 You will not copy, replicate, or reconstruct (or attempt any of them, or procure a third party to undertake any of them on Your behalf) any aspect of the Services.\\015\\012\\015\\0129. CHARGES\\015\\012\\015\\0129.1 You acknowledge and agree that the provision of the Services to You is subject to the payment of the Charges. In the event that the Charges are not paid within the period of time as specified by Us, We will notify You by email.\\015\\012\\015\\0129.2 You also acknowledge that elements of the Services are dependent on the fulfilment of tasks by the Buyer, Seller, Buyer\\342\\200\\231s Conveyancer and Seller\\342\\200\\231s Conveyancer. To the extent that any of the above fails to fulfil these tasks, We may be unable to provide the Seller\\342\\200\\231s Conveyancer\\342\\200\\231s Data, the Seller\\342\\200\\231s data, or any information in relation to the Property in the Report.\\015\\012\\015\\0129.3 You also acknowledge that elements of the Services are dependent on the payment of further charges. To the extent that if the charges remain unpaid, We will be unable to provide Insurance or any information in relation to the Property in the Report.\\015\\012\\015\\01210. BARRING FROM THE SYSTEM\\015\\012\\015\\01210.1 We reserve the right to bar users from the Portal and/or restrict or block their access or use of any and all elements of the Services, on a permanent or temporary basis at Our sole discretion. Any such user shall be notified and must not then attempt to use the Services under any other name or through any other user. \\015\\012\\015\\01211. WARRANTY\\015\\012\\015\\01211.1 Whilst We endeavour to ensure that any material provided under the Services and available from the Portal and Website is not contaminated in any way, We do not warrant that such material will be free from infection, viruses and/or similar code. We also do not accept any liability for loss of Your password or account ID caused by a breakdown, error, loss of power or otherwise caused by or to Your computer system or network.\\015\\012\\015\\01211.2 We warrant that:\\015\\012\\015\\01211.2.1 The Services will be performed with reasonable skill and care and in accordance with these Terms and Conditions;\\015\\012\\015\\01211.2.2 We are authorised to provide the Services;\\015\\012\\015\\01211.2.3 the provision of the Services will not infringe any third party Intellectual Property Rights; and\\015\\012\\015\\01211.2.4 the Services will comply with all relevant laws, regulations and codes of practice.\\015\\012\\015\\01211.3 Due to the nature of software and the internet, We do not warrant that Your access to, or the running of, the Portal will be uninterrupted or error free. We shall not be liable if We cannot process Your request due to circumstances beyond Our reasonable control.\\015\\012\\015\\01211.4 The information provided under the Services does not constitute specific advice. Whilst We endeavour to ensure that the information provided is accurate, complete and up-to-date We make no warranties or representations that this is the case.\\015\\012\\015\\01211.5 We make no warranty or guarantee that the Services, Website or Portal, or any information available over any of them, comply with laws other than those of England and Wales.\\015\\012\\015\\01211.6 To the maximum extent permitted by law, We make no representations, warranties or conditions of any kind, either express or implied, with respect to any data provided by a Third Party Data Provider, including (but not limited to) any warranty that the responses are complete, accurate, of satisfactory quality, or fit for a particular purpose.\\015\\012\\015\\01212. LIABILITY\\015\\012\\015\\01212.1 Nothing in these Terms and Conditions will be deemed to exclude Our liability to You for death or personal injury arising from Our negligence, or any other liability the exclusion or restriction of which is expressly prohibited by law. \\015\\012\\015\\01212.2 You acknowledge and accept that We only provide the Services on the express condition that We will not be responsible for nor shall We have any liability to You, the Clients, the Seller, the Seller\\342\\200\\231s Conveyancer, the Buyer\\342\\200\\231s Conveyancer, any Party or any third party directly, indirectly, whether in contract, tort or otherwise for:\\015\\012\\015\\01212.2.1 Inaccuracies or errors in or omissions from any data provided by a Third Party Data Provider;\\015\\012\\015\\01212.2.2 inaccuracies or errors in or omissions from any register or other information source maintained or used by a Third Party Data Provider; or\\015\\012\\015\\01212.2.3 any act or omission by a Third Party Data Provider.\\015\\012\\015\\01212.3 We shall not be liable for any loss or damage sustained by You, the Clients, or any other third party directly or indirectly whether in contract, tort or otherwise making use of or relying on the Report including but not limited to any loss or damage resulting as a consequence of:\\015\\012\\015\\01212.3.1 any failure by You to have in place all necessary means of receiving the Report, the maintenance of internet access, appropriate email facilities or security measures; or\\015\\012\\015\\01212.3.2 (i) inaccuracies or errors in or omission from any Report; or (ii) any Report which is inaccurate, incomplete, illegal, out of sequence or in the wrong form, or in respect of the wrong Client; unless and then only to the extent that, the loss or damage sustained shall be as a direct consequence of the negligent act or omission by Us.\\01